import React from 'react';
import { Grid, Image, Segment, Header } from 'semantic-ui-react';
import MovieInfo from '../HeaderSegement/Explore/MovieInfo';
import vk from "../Images/vk.jpg"



const HeaderPart = () => {
    return (
        <React.Fragment>
            <Grid columns="2" inverted>
                <Grid.Row textAlign='right'>
                    <Grid.Column width={5}>
                        a
                    </Grid.Column>
                    <Grid.Column width={11}>
                        <Header placeholder>
                            <Image
                            style={{
                                opacity: 1,
                                width:"100%",
                                height:"100%",
                                backgroundImage: `url(${vk})`,
                                backgroundSize: 'cover', 
                                fontWeight: 'normal',
                                marginBottom: 0
                            }}
                        />
                        </Header>
                            <MovieInfo url="https://www.youtube.com/watch?v=3PK2tIyENVA&t=2s" />
                            <br />
                            <MovieInfo url="https://www.youtube.com/watch?v=3PK2tIyENVA&t=2s" />
                        {/* </Header> */}
                    </Grid.Column>
                </Grid.Row>
            </Grid>
        </React.Fragment>
    )
}

export default HeaderPart;
